import { Route, Routes } from 'react-router-dom';
import './App.css';
import Connection from './Components/Connection/Connection';

function App() {
  return (
    <div>
      <Connection/>
      <Routes>
        <Route path='/AflamCom_Identification' element={<Connection/>}/>
      </Routes>
    </div>
  );
}

export default App;
